/* Magnific Popup -------------------------------------------------------------------- */
.mfp-bg{top:0;left:0;width:100%;height:100%;z-index:9042;overflow:hidden;position:fixed;background:#0b0b0b;opacity:.8}
.mfp-wrap{top:0;left:0;width:100%;height:100%;z-index:9043;position:fixed;outline:none!important;-webkit-backface-visibility:hidden}
.mfp-container{text-align:center;position:absolute;width:100%;height:100%;left:0;top:0;padding:0 8px;box-sizing:border-box}
.mfp-container:before{content:'';display:inline-block;height:100%;vertical-align:middle}
.mfp-align-top .mfp-container:before{display:none}
.mfp-content{position:relative;display:inline-block;vertical-align:middle;margin:0 auto;text-align:left;z-index:9045}
.-holder .mfp-content,.mfp-ajax-holder .mfp-content{width:100%;cursor:auto}
.mfp-ajax-cur{cursor:progress}
.mfp-zoom-out-cur,.mfp-zoom-out-cur .mfp-image-holder .mfp-close{cursor:-moz-zoom-out;cursor:-webkit-zoom-out;cursor:zoom-out}
.mfp-zoom{cursor:pointer;cursor:-webkit-zoom-in;cursor:-moz-zoom-in;cursor:zoom-in}
.mfp-auto-cursor .mfp-content{cursor:auto}
.mfp-close,.mfp-arrow,.mfp-preloader,.mfp-counter{-webkit-user-select:none;-moz-user-select:none;user-select:none;background:none!important}
.mfp-loading.mfp-figure{display:none}
.mfp-hide{display:none!important}
.mfp-preloader{color:#CCC;position:absolute;top:50%;width:auto;text-align:center;margin-top:-.8em;left:8px;right:8px;z-index:9044}
.mfp-preloader a{color:#CCC}
.mfp-preloader a:hover{color:#FFF}
.mfp-s-ready .mfp-preloader{display:none}
.mfp-s-error .mfp-content{display:none}
button.mfp-close,button.mfp-arrow{overflow:visible;cursor:pointer;background:transparent;border:0;-webkit-appearance:none;display:block;outline:none;padding:0;z-index:9046;box-shadow:none;touch-action:manipulation}
button::-moz-focus-inner{padding:0;border:0}
.mfp-close{width:44px;height:44px;line-height:44px;position:absolute;right:0;top:0;text-decoration:none;text-align:center;opacity:.65;padding:0 0 18px 10px;color:#FFF;font-style:normal;font-size:28px;font-family:Arial,Baskerville,monospace}
.mfp-close:hover,.mfp-close:focus{opacity:1}
.mfp-close:active{top:1px}
.mfp-close-btn-in .mfp-close{color:#333}
.mfp-image-holder .mfp-close,.mfp-iframe-holder .mfp-close{color:#FFF;right:-6px;text-align:right;padding-right:6px;width:100%}
.mfp-counter{position:absolute;top:0;right:0;color:#CCC;font-size:12px;line-height:18px;white-space:nowrap}
.mfp-arrow{position:absolute;opacity:.65;margin:0;top:50%;margin-top:-55px;padding:0;width:90px;height:110px;-webkit-tap-highlight-color:transparent}
.mfp-arrow:active{margin-top:-54px}
.mfp-arrow:hover,.mfp-arrow:focus{opacity:1}
.mfp-arrow:before,.mfp-arrow:after{content:''!important;display:block!important;width:0;height:0;position:absolute;left:0;top:0;margin-top:35px;margin-left:35px;border:medium inset transparent;background:none}
.mfp-arrow:after{border-top-width:13px;border-bottom-width:13px;top:8px}
.mfp-arrow:before{border-top-width:21px;border-bottom-width:21px;opacity:.7}
.mfp-arrow-left{left:0}
.mfp-arrow-left:after{border-right:17px solid #FFF;margin-left:31px}
.mfp-arrow-left:before{margin-left:25px;border-right:27px solid #3F3F3F}
.mfp-arrow-right{right:0}
.mfp-arrow-right:after{border-left:17px solid #FFF;margin-left:39px}
.mfp-arrow-right:before{border-left:27px solid #3F3F3F}
.mfp-iframe-holder{padding-top:40px;padding-bottom:40px}
.mfp-iframe-holder .mfp-content{line-height:0;width:100%;max-width:900px}
.mfp-iframe-holder .mfp-close{top:-40px}
.mfp-iframe-scaler{width:100%;height:0;overflow:hidden;padding-top:56.25%}
.mfp-iframe-scaler iframe{position:absolute;display:block;top:0;left:0;width:100%;height:100%;box-shadow:0 0 8px rgba(0,0,0,0.6);background:#000}
img.mfp-img{width:auto;max-width:100%;height:auto;display:block;line-height:0;box-sizing:border-box;padding:40px 0;margin:0 auto}
.mfp-figure{line-height:0}
.mfp-figure:after{content:'';position:absolute;left:0;top:40px;bottom:40px;display:block;right:0;width:auto;height:auto;z-index:-1;box-shadow:0 0 8px rgba(0,0,0,0.6);background:#444}
.mfp-figure small{color:#BDBDBD;display:block;font-size:12px;line-height:14px}
.mfp-figure figure{margin:0}
.mfp-bottom-bar{margin-top:-36px;position:absolute;top:100%;left:0;width:100%;cursor:auto}
.mfp-title{text-align:left;line-height:18px;color:#F3F3F3;word-wrap:break-word;padding-right:36px}
.mfp-image-holder .mfp-content{max-width:100%}
.mfp-gallery .mfp-image-holder .mfp-figure{cursor:pointer}

.mfp-wrap button:after{width:0!important;height:0!important;background:none!important}
.button-flat .mfp-arrow:after{top:8px;opacity:1}
.button-stroke .mfp-close{color:#fff!important}
.button-stroke .mfp-close:hover{background:none!important}
.button-stroke .mfp-arrow:hover{background:none!important}

.mfp-inline{display:block!important;position:relative;background:#FFF;padding:25px 30px;width:auto;max-width:500px;margin:20px auto;}
.mfp-inline p:nth-last-child(2){margin-bottom:0;}
.button-stroke .mfp-inline .mfp-close{color:#333!important}

@media screen and (max-width: 800px) and (orientation: landscape),screen and (max-height: 300px) {
	.mfp-img-mobile .mfp-image-holder{padding-left:0;padding-right:0}
	.mfp-img-mobile img.mfp-img{padding:0}
	.mfp-img-mobile .mfp-figure:after{top:0;bottom:0}
	.mfp-img-mobile .mfp-figure small{display:inline;margin-left:5px}
	.mfp-img-mobile .mfp-bottom-bar{background:rgba(0,0,0,0.6);bottom:0;margin:0;top:auto;padding:3px 5px;position:fixed;box-sizing:border-box}
	.mfp-img-mobile .mfp-bottom-bar:empty{padding:0}
	.mfp-img-mobile .mfp-counter{right:5px;top:3px}
	.mfp-img-mobile .mfp-close{top:0;right:0;width:35px;height:35px;line-height:35px;background:rgba(0,0,0,0.6);position:fixed;text-align:center;padding:0}
}

@media all and (max-width: 900px) {
	.mfp-arrow{-webkit-transform:scale(0.75);transform:scale(0.75)}
	.mfp-arrow-left{-webkit-transform-origin:0;transform-origin:0}
	.mfp-arrow-right{-webkit-transform-origin:100%;transform-origin:100%}
	.mfp-container{padding-left:6px;padding-right:6px}
}

/* Slick Slider ---------------------------------------------------------------------- */
.slick-slider{position:relative;display:block;box-sizing:border-box;-webkit-user-select:none;-moz-user-select:none;-ms-user-select:none;user-select:none;-webkit-touch-callout:none;-khtml-user-select:none;-ms-touch-action:pan-y;touch-action:pan-y;-webkit-tap-highlight-color:transparent}
.slick-list{position:relative;display:block;overflow:hidden;margin:0;padding:0}
.slick-list:focus{outline:none}
.slick-list.dragging{cursor:pointer;cursor:hand}
.slick-slider .slick-track,.slick-slider .slick-list{-webkit-transform:translate3d(0,0,0);-moz-transform:translate3d(0,0,0);-ms-transform:translate3d(0,0,0);-o-transform:translate3d(0,0,0);transform:translate3d(0,0,0)}
.slick-track{position:relative;top:0;left:0;display:block}
.slick-track:before,.slick-track:after{display:table;content:''}
.slick-track:after{clear:both}
.slick-loading .slick-track{visibility:hidden}
.slick-slide{display:none;float:left;height:100%;min-height:1px;outline:none}
[dir='rtl'] .slick-slide{float:right!important}
.slick-slide img{display:block;margin-left:auto;margin-right:auto;}
.slick-slide.slick-loading img{display:none}
.slick-slide.dragging img{pointer-events:none}
.slick-initialized .slick-slide{display:block}
.slick-loading .slick-slide{visibility:hidden}
.slick-vertical .slick-slide{display:block;height:auto;border:1px solid transparent}
.slick-arrow.slick-hidden{display:none}

/* The Events Callendar -------------------------------------------------------------- */
.tribe-events-page-template #Subheader .title{width:60%}
.tribe-events-page-template #Subheader ul.breadcrumbs{width:40%}
.tribe-events-list .tribe-events-event-image + div.tribe-events-content{padding-right:0!important;}
#tribe-bar-views .tribe-bar-views-list{z-index:29}
#tribe-bar-form input[type="text"]{font-weight:400}
h2.tribe-events-page-title,#tribe-geo-results h2.tribe-events-page-title{font-weight:400}
.tribe-events-list-separator-month{font-weight:400}
#tribe-events-content .tribe-events-tooltip h4{font-weight:400}
.tribe-events-meta-group .tribe-events-single-section-title{font-weight:400}
.events-list .tribe-events-loop,.tribe-events-day .tribe-events-loop,.single-tribe_venue .tribe-events-loop,.single-tribe_organizer .tribe-events-loop{max-width:100%}
a.tribe-events-ical{margin-top:0}
.tribe-events-cal-links a.tribe-events-gcal{margin-top:0}
.single-tribe_events #tribe-events-content .tribe-events-event-meta dt{clear:left;font-weight:700;line-height:inherit}
.single-tribe_events #tribe-events-content .tribe-events-event-meta dd{float:inherit;line-height:inherit;list-style:none outside none;margin:0 0 0 110px;padding:10px 0}
.single-tribe_events #tribe-events-content .tribe-events-event-meta dd:after{display:none}
#tribe-bar-form{background-image:url(/8b0e06d13df51c244bc85f7b6b24cb71.png)}
.tribe-events-back{padding:15px 10px;margin-bottom:20px;background-image:url(/8b0e06d13df51c244bc85f7b6b24cb71.png);-webkit-box-sizing:border-box;-moz-box-sizing:border-box;box-sizing:border-box;overflow:hidden}
ul.tribe-events-sub-nav a,.tribe-events-back a{font-size:14px;font-weight:400}
.tribe-events-event-image{border:8px solid #f8f8f8;box-sizing:border-box;display:block;line-height:0}
.tribe-events-list-widget ol{padding:10px 0 0 30px}
.tribe-events-list-widget ol li{margin-bottom:20px;list-style-type:square;padding-left:4px}
.tribe-events-list-widget ol li:before{display:none}
.tribe-events-list-widget ol li h4{font-size:16px;line-height:20px;margin-bottom:5px}
.tribe-events-list-widget ol li .duration{font-weight:400;color:rgba(0,0,0,.4)}
.tribe-events-list-widget p.tribe-events-widget-link{margin-left:30px;padding-top:8px;border-top:1px solid rgba(0,0,0,0.08)}
.tribe-events-list-widget p.tribe-events-widget-link a{font-weight:400;font-size:13px}
.tribe-events-list-separator-month span{background:#fcfcfc}
.tribe-events-event-meta,.tribe-events-promo{color:#a8a8a8}
.tribe-events-calendar thead th{color:#444;border-color:rgba(0,0,0,0.08)}

/* UI Datepicker --------------------------------------------------------------------- */
.ui-datepicker .ui-datepicker-title select{padding:inherit;width:auto;display:inline-block;margin:auto;-webkit-appearance:menulist}
.ui-datepicker .ui-datepicker-calendar .ui-state-highlight{margin:-1px}
.ui-datepicker .ui-datepicker-calendar .ui-state-default{box-shadow:0 0 0 0 rgba(0,0,0,.0)}
.ui-datepicker table tr{border:0!important}
.ui-datepicker table tr td{border-width:0 1px 1px 0 !important;border-style:solid;border-color:#DEDEDE;padding:1px}
.ui-datepicker table td a,.ui-datepicker table td span{width:auto!important;display:block!important}
.ui-datepicker table tr:first-child td{background:inherit!important}
.ui-datepicker table tr:hover td{background:inherit!important;color:inherit!important}
.ui-datepicker table tr:hover td a{color:inherit!important}
.ui-datepicker table tr:nth-child(2n) td{background:inherit!important}

/* Visual Composer | Frontend Editor ------------------------------------------------- */
.wpb_wrapper > div{margin-bottom:35px}
.wpb_wrapper.ui-sortable .vc_call_to_action{background:none;border:none;padding:0}
body.layout-boxed .vc_row[data-vc-stretch-content="true"]{left:0!important;width:auto!important;margin-left:-2.7%;margin-right:-2.7%}
body.layout-boxed .vc_row-no-padding .wpb_column{padding:0}
.vc_images_carousel{width:auto!important}
.wpb_wrapper .portfolio_group{font-size:inherit!important;line-height:inherit!important;color:inherit!important}
.wpb_wrapper .portfolio_group.flat .portfolio-item,.wpb_wrapper .portfolio_group.masonry-flat .portfolio-item{margin-bottom:0}
.wpb_wrapper .portfolio_group .portfolio-item .image_frame{margin-bottom:0}
.wpb_wrapper .wpcf7-form{display:inline-block}

/* Grid 1240px ----------------------------------------------------------------------- */
body								{ min-width: 960px;}
body.admin-bar						{ position:relative;}

#Wrapper 							{ max-width: 1240px; margin: 0px auto; overflow:hidden; -webkit-box-shadow: 0px 0px 15px rgba(0, 0, 0, .06); box-shadow: 0px 0px 15px rgba(0, 0, 0, .06);}

.layout-boxed						{ padding: 25px 0;}
.layout-boxed.boxed-no-margin		{ padding: 0; }
.layout-full-width 					{ padding: 0; }
.layout-full-width #Wrapper 		{ max-width: 100% !important; width: 100% !important; margin: 0 !important; }

#Content 							{ width: 100%; padding-top: 30px;}
#Content.no-padding,
.template-slider #Content,
.with_aside #Content				{ padding-top: 0; }

.with_aside .sections_group			{ padding-top: 30px; }

.section							{ position: relative; }
.section_wrapper,
.container							{ max-width: 1220px; margin:0 auto; position:relative;}
.section.full-width > .section_wrapper	{ max-width: 100% !important; padding-left:0!important; padding-right:0!important;}

.section_wrapper:after,
.container:after					{ clear: both; content: " "; display: block; height: 0; visibility: hidden;}

.mcb-wrap							{ float:left; position:relative; z-index:1; -webkit-box-sizing:border-box; box-sizing:border-box;}
.mcb-wrap.divider					{ width:100%;}

.column, .columns					{ float: left; margin:0 1% 40px;}
.the_content_wrapper				{ margin: 0 1%;}
.column_content .the_content_wrapper	{ margin: 0;}

.sidebar, .widget-area				{ box-sizing:border-box;}

/* Wrap | Equal Height */
.equal-height-wrap .mcb-wrap .mcb-wrap-inner { position:relative; float:left; width:100%;}

.equal-height-wrap .mcb-wrap.valign-middle .mcb-wrap-inner { top:50%; 
	-webkit-transform:translateY(-50%); -moz-transform:translateY(-50%); -ms-transform:translateY(-50%); -o-transform:translateY(-50%); transform:translateY(-50%);}
.equal-height-wrap .mcb-wrap.valign-bottom .mcb-wrap-inner { top:100%;
	-webkit-transform:translateY(-100%); -moz-transform:translateY(-100%); -ms-transform:translateY(-100%); -o-transform:translateY(-100%); transform:translateY(-100%);}

/* Sizes ----------------------------------------------------------------------------- */

/* .mcb-wrap */
.one-sixth.mcb-wrap					{ width: 16.666%; }		/* 1/6 */
.one-fifth.mcb-wrap					{ width: 20%; }			/* 1/5 */
.one-fourth.mcb-wrap				{ width: 25%; }			/* 1/4 */
.one-third.mcb-wrap					{ width: 33.333%; }		/* 1/3 */
.two-fifth.mcb-wrap					{ width: 40%; }			/* 2/5 */

.one-second.mcb-wrap				{ width: 50%; }			/* 1/2 */
.three-fifth.mcb-wrap				{ width: 60%; }			/* 3/5 */
.two-third.mcb-wrap					{ width: 66.666%; }		/* 2/3 */
.three-fourth.mcb-wrap				{ width: 75%; }			/* 3/4 */
.four-fifth.mcb-wrap				{ width: 80%; }			/* 4/5 */
.five-sixth.mcb-wrap				{ width: 83.333%; }		/* 5/6 */
.one.mcb-wrap						{ width: 100%; }		/* 1/1 */

/* .column */
.one-sixth.column					{ width: 14.666%; }		/* 1/6 */
.one-fifth.column					{ width: 18%; }			/* 1/5 */
.one-fourth.column, .four.columns	{ width: 23%; }			/* 1/4 */
.one-third.column					{ width: 31.333%; }		/* 1/3 */
.two-fifth.column					{ width: 38%; }			/* 2/5 */

.one-second.column					{ width: 48%; }			/* 1/2 */
.three-fifth.column					{ width: 58%; }			/* 3/5 */
.two-third.column					{ width: 64.666%; }		/* 2/3 */
.three-fourth.column				{ width: 73%; }			/* 3/4 */
.four-fifth.column					{ width: 78%; }			/* 4/5 */
.five-sixth.column					{ width: 81.333%; }		/* 5/6 */
.one.column							{ width: 98%; }			/* 1/1 */

.section.full-width > .one.column,
.section.full-width > .section_wrapper > .one.column,
.section.full-width .one.wrap .one.column	{ width:100%; margin: 0; }

/* .Sidebar | .with_aside */
.with_aside .content_wrapper		{ max-width: 1240px; margin:0 auto;}

.with_aside .sections_group			{ width: 75%; float:left;}

.with_aside .section_wrapper		{ max-width:98%; max-width:calc( 100% - 20px );}

.with_aside .four.columns			{ float: right; margin:0;}

.aside_left .sections_group			{ float: right;}
.aside_left .four.columns			{ float: left;}

/* Sidebar - Both | .aside_both */
.aside_both .sections_group			{ width: 60%; margin-left:20%;}
.aside_both .sidebar.columns		{ width: 18%; }
.aside_both .sidebar-1				{ float: left !important; margin-left:-79%; }

/* Column ---------------------------------------------------------------------------- */

/* Column | Margin - Horizontal */
.no-margin-h .column				{ margin-left:0; margin-right:0; }
.no-margin-h .one-sixth.column		{ width: 16.666%; }		/* 1/6 */
.no-margin-h .one-fifth.column		{ width: 20%; }			/* 1/5 */
.no-margin-h .one-fourth.column		{ width: 25%; }			/* 1/4 */
.no-margin-h .one-third.column		{ width: 33.333%; }		/* 1/3 */
.no-margin-h .two-fifth.column		{ width: 40%; }			/* 2/5 */

.no-margin-h .one-second.column		{ width: 50%; }			/* 1/2 */
.no-margin-h .three-fifth.column	{ width: 60%; }			/* 3/5 */
.no-margin-h .two-third.column		{ width: 66.666%; }		/* 2/3 */
.no-margin-h .three-fourth.column	{ width: 75%; }			/* 3/4 */
.no-margin-h .four-fifth.column		{ width: 80%; }			/* 4/5 */
.no-margin-h .five-sixth.column		{ width: 83.333%; }		/* 5/6 */
.no-margin-h .one.column			{ width: 100%; }		/* 1/1 */

/* Column | Margin - Bottom */

/* set in section options */
.column.column_divider				{ margin-bottom: 0 !important;}

.column-margin-0px .column			{ margin-bottom: 0 !important;}
.column-margin-10px .column			{ margin-bottom: 10px !important;}
.column-margin-20px .column			{ margin-bottom: 20px !important;}
.column-margin-30px .column			{ margin-bottom: 30px !important;}
.column-margin-40px .column			{ margin-bottom: 40px !important;}
.column-margin-50px .column			{ margin-bottom: 50px !important;}

/* set in item options */
.column-margin-0px.column			{ margin-bottom: 0 !important;}
.column-margin-10px.column			{ margin-bottom: 10px !important;}
.column-margin-20px.column			{ margin-bottom: 20px !important;}
.column-margin-30px.column			{ margin-bottom: 30px !important;}
.column-margin-40px.column			{ margin-bottom: 40px !important;}
.column-margin-50px.column			{ margin-bottom: 50px !important;}

/* Column | Equal Height */
.equal-height .column .column_attr{height:100%;box-sizing:border-box}

/* Column | Align */
.column_attr.align_left{text-align:left}
.column_attr.align_right{text-align:right}
.column_attr.align_center{text-align:center}
.column_attr.align_justify{text-align:justify}

/* Extra Content */
.extra_content .the_content_wrapper{margin:0 1%}
.extra_content .has_content .the_content_wrapper,.extra_content .category_description .the_content_wrapper{margin-bottom:40px}

/* Clearing -------------------------------------------------------------------------- */
.container:after{content:"\0020";display:block;height:0;clear:both;visibility:hidden}
.clearfix:before,.clearfix:after{content:'\0020';display:block;overflow:hidden;visibility:hidden;width:0;height:0}
.clearfix:after{clear:both}
.clearfix{zoom:1}
.clear{clear:both;display:block;overflow:hidden;visibility:hidden;width:0;height:0}

